I run my own business, raise little girls as a single mom, train 5 days a week, and stay active in my recovery by chairing meetings and doing step work. 
Slacking on my goals is not an option for me.  Excuses don't fly in my world. 
There is no "I don't have time to go to the store and meal prep" this week or any week.  Fast food and delivery is not an option. 
.
So, what do I do?
Back up plans. Always always always have back up plans for any excuse I can possibly have to not stick to my goals. 
.
When I meal prep, I make a little extra protien, weigh it and throw it in a freezer bag for times like these when I need to make it a couple more days till I can get to the store or prep again. 
Frozen and canned food is not the BEST but its better than fast food or eating off plan.  I have frozen sweat potato and canned green beans I will throw with this for lunch today until I can get to the store later and cook tonight. 
.
